import './Menu.css';
const MenuDropDown = () => {
    return (
        <div className="dropdown">
            <ul className="dropdown-menu">
                <li className="dropdown-item">Trang Tài Khoản</li>
                <li className="dropdown-item">Đơn Hàng</li>
                <li className="dropdown-item">Tài Khoản</li>
                <li className="dropdown-item">Lịch Sử Giao Dịch</li>
                <li className="dropdown-item">Đăng Xuất</li>
            </ul>
        </div>

    );
}
export default MenuDropDown;
